  return (
    <>
      <footer className="mt-24 p-4 border-nblack border-2 ">
        <div>
          <a
            className="text-2xl font-medium"
            href="mailto:rouet.alexis99@gmail.com">
            rouet.alexis99@gmail.com
          </a>
          <p>
            J’aime imaginer, concevoir et intégrer des interfaces qui apporte
            des émotions, une satisfaction et une utilitée aux
            <span className="line-through mx-2">utiliateurs</span>
