          </p>
          <div>
            <span>LinkedIn</span>
            <ArrowForwardIcon />
          </div>
          <p>Ce site a été crée avec ♡ | Copyright© Alexis Rouet.</p>
          <a href="#">Mentions légales/Confidentialité</a>
        </div>
      </footer>
    </>
  );
};

